import { createBrowserRoute, RouterProvider } from "react-router-dom";
import HomePage from "./pages/Home";


const router = createBrowserRouter([
  {
    path: "/", element: <HomePage />
  }
]);

function App() {
  return <RouterProvider router={router} />
}

export default App;
